package main.fil;

/**
 * @author Franck Armel Malko
 *
 */
public class LineValue {
	private String line;
	/**
	 * 
	 */
	public LineValue() {
		// TODO Auto-generated constructor stub
		super();
		this.line = null;
	}

	/**
	 * @param line
	 */
	public LineValue(String line) {
		super();
		this.line = line;
	}
	
	/**
	 * @return the line
	 */
	public String getLine() {
		return line;
	}
	
	/**
	 * @param line the line to set
	 */
	public void setLine(String line) {
		this.line = line;
	}

}